import React from 'react';
import logo from './logo.svg';
import './App.css';
import Button from 'react-bootstrap/Button'
import 'bootstrap/dist/css/bootstrap.min.css';
import './Mypage.scss'


function App() {
  return (
    <div className="backg">
      <div className="buttons">
        <Button className="button1" variant="outline-dark">Primary</Button>
        <Button className="button2" variant="outline-dark">Primary</Button>
      </div>
    </div>
  );
}

export default App;
